import React, { Component } from 'react';
import SearchBar from '../home/searchbar/SearchBar';
import WishlistCard from './../home/wishlist/WishlistCard';
import NewsCard from '../home/newsInfo/NewsCard';

class SignUp extends Component {
    render() {
        return (
            <div>
                <SearchBar/>
                <br/>
                <br/>
                <br/>
                <h2>Wish List</h2>
                <WishlistCard/><NewsCard/>
                <WishlistCard/><NewsCard/>
                <WishlistCard/>
                <NewsCard/>
                <WishlistCard/>
                <WishlistCard/>
                <WishlistCard/>
            </div>
        );
    }
}

export default SignUp;
